import React, { useState } from "react";

function UseStateWithArrays() {
	const [nums, setnums] = useState(0);

	const updateNum = () => {
		setnums(nums + 1);
	};
	return (
		<div>
			<button type="button" class="btn btn-primary" onClick={updateNum}>
				Button
			</button>
			{nums.map((num) => {
				<li key={num}>{num}</li>;
			})}
		</div>
	);
}

export default UseStateWithArrays;
